(function(){
    var i,
        nd = stm_document, /* орд документ */
        registrars = edsGlobalSettings.getRegistrars("DA_REGISTRARS", nd), /* получение списка регистраторов по документу */
        registrarsCount = registrars.length,
        notification;

    /* раздаем права регистраторам */
    for(i = 0; i < registrarsCount; ++i) {
        statemachine.grandDynamicRoleForEmployee(nd, registrars[i], "DA_REGISTRAR_DYN", task);
    }

    /* подготавливаем уведомление */
    notification = ordStatemachine.prepareNotificationAboutRegistration(nd, registrars);

    /* рассылаем уведомление */
    notifications.sendNotification(notification);
})();

